import React from "react";
import star from "./assets/star.png"


export default function Card(props){
    return(
        <section className="Card">
            <img className = "cover" src={props.img} alt ="girl"></img>
            <h4> <span><img src = {star} alt = "star"></img></span>{props.rating}<span className="who">{props.review} . {props.country}</span></h4>
            <p>{props.title}</p>
            <h3 className="cost">From {props.cost} <span>/ person</span></h3>
        </section>
    )
}
